
use MECANICA

create table Cliente (
Cliente_COD int primary key identity,
Cliente_nome varchar(50),
Cliente_telefone varchar(50)
)

create table Funcionario (
F_COD int primary key identity,
F_nome varchar(50),
F_especialidade varchar(50),
F_telefone varchar(50)
)


create table Carro(
CARRO_COD int primary key identity,
CARRO_ClienteCOD int,
CARRO_marca varchar(50),
CARRO_modelo varchar(50),
CARRO_DataFabrico date,
CARRO_fabricante varchar(50),
CARRO_valor numeric,
foreign key (CARRO_ClienteCOD) references Cliente(Cliente_COD)
)

create table Reparacao (
R_COD int primary key identity,
R_FuncionarioCOD int,
R_CarroCOD int,
R_data date,
R_descricao varchar(50),
R_Custo numeric,
foreign key (R_FuncionarioCOD) references Funcionario(F_COD),
foreign key (R_CarroCOD) references Carro(CARRO_COD)
)




